using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using ACLibrary.Crypto.MixCryptSeries;

namespace TestREncryptLibs
{
    [TestClass]
    public class TestMixCrypt_E
    {
        [TestMethod]
        public void Test_Mid_EmptyString()
        {
            string oldString = @"";

            Assert.AreEqual(oldString, Mid.Instance.EncryptString("", ""));
        }

        [TestMethod]
        public void Test_Mid_SomeString_WPass()
        {
            string oldString = @"";

            Assert.AreEqual(oldString, Mid.Instance.EncryptString("Hyper-V", "112"));
        }

        [TestMethod]
        public void Test_Stronger_EmptyString()
        {
            string oldString = @"";

            Assert.AreEqual(oldString, Stronger.Instance.EncryptString("", ""));
        }

        [TestMethod]
        public void Test_Weaker_EmptyString()
