            string oldString = @"4iPMw3v5j+XDsB6iqpf4UuqyFYuwPIyzSGYIVZvXPsu/rzAExM033n+YTxkK2FJ5r+bmi43NFLUNN4hUC6YCWMmR8S1DoapYeDm5tZJRGhcU/w3d5KWM+fc/0J5pv9/Uujdgeps7wNqoHtHFYPsh9FJyy50gPUZCTj/lUmJU2qf4J/ITMEB3Mi1ioz47gCjZE2PwSZZ4nEBWEch/8tsWNHy55dKH54NiuTnTXK40+WBiEfGFGAf/1frFAF04Wxpq";
            Assert.AreEqual(oldString, Weaker.Instance.EncryptString("", ""));
        }
    }
}
